package 字符串;

import java.util.*;

public class L_438_找到字符串中所有的字母异位词 {

    public static void main(String[] args) {
        System.out.println(findAnagrams("",
                ""));
    }


    public static List<Integer> findAnagrams(String s, String p) {
        List<Integer> list = new ArrayList<>();
        if(s.length()<p.length()){
            return list;
        }

        Map<Character,Integer> need = new HashMap<>();
        Map<Character,Integer> window = new HashMap<>();
        for(int i=0;i<p.length();i++){
            need.put(p.charAt(i),need.getOrDefault(p.charAt(i),0)+1);
        }
        for(int i=0;i<p.length();i++){
            window.put(s.charAt(i),window.getOrDefault(s.charAt(i),0)+1);
        }
        if (isYiwei(need,window)){
            list.add(0);
        }
        for(int i=p.length();i<s.length();i++){
            window.put(s.charAt(i-p.length()),window.get(s.charAt(i-p.length()))-1);
            window.put(s.charAt(i),window.getOrDefault(s.charAt(i),0)+1);
            if(isYiwei(need,window)){
                list.add(i-p.length()+1);
            }
        }
        return list;
    }

    public static boolean isYiwei(Map<Character,Integer> need,Map<Character,Integer> window){
        for (Character character: need.keySet()) {
            if(!need.get(character).equals(window.getOrDefault(character,0))){
                return false;
            }
        }
        return true;
    }
}


